INSERT INTO `ycity_company` VALUES ('1', '天津市施迪翰建筑工程有限公司', '民营', '20-99', '天津市施迪翰建筑工程有限公司创建于2002年，是经天津市工商局注册具有独立法人资格的实体单位。公司具有钢结构专业承包叁级资质及建筑装饰、防水防腐专业承包贰级，主要从事建筑工程建筑装饰工程、防水工程、钢结构制作安装工程、机电设备安装工程，园林古建筑工程，园林绿化工程及金属结构制作安装。 施迪翰建筑工程有限公司注册资本1500万元，公司具有钢结构加工厂，工厂配有一流加工设备，如H型钢生产线，箱型梁生产线，自动焊接生产线，林克曼数控，相贯线下料机，等离子数控切割机，数控液压板料折弯机，H型钢龙门式焊接机，组立机，抛丸机，矫正机等。 公司集设计、施工、制造、安装服务为一体，公司设有设计部、工程部、材料部、经营部、生产部等多个职能科室，其中设计人员由博士生、研究生高等学历人员组织设计团队。 公司始终坚持“以质量求生存，考信誉谋发展”的质量方针。公司成立十多年来。承建了一大批国家及市重点工程和高档办公场所的装饰装修工程、防水工程、钢结构制作安装工程，深得客户的满意；近年来我公司又与VEROMODA、家乐福、亚光耐普罗、海尔集团、天津二建、天津三建、上海烟草集团、天津安装公司、天津市管道集团等国际国内公司合作，成为其最信任的合作伙伴。 公司系国家钢结构专业叁级资质及建筑装饰、防水防腐专业承包贰级企业，公司在同行业中率先通过了ISO 9000质量管理体系、环境管理体系、职业健康安全管理体系认证。现为钢结构协会会员单位及天津市建筑协会先进企业。天津室内装饰协会理事单位。并连续多年被中国建筑装饰协会授予“绿色家装受检单位”，被天津建筑装饰协会评为“全国建筑装饰优秀企业”、“天津市3.15消费者信得过企业”、“北方调查最佳荣誉单位”、“天津市重合同守信誉单位”。 施迪翰建筑工程公司在激烈的市场竞争');
