INSERT INTO `ycity_notice` VALUES ('1', '档案查询', '<p>2015届毕业生档案已于2015年7月23日通过中国邮政速递（EMS）寄出，如有问题可通过中国邮政速递网站（www.ems.com.cn）进行查询。</p><p>EMS运单号为“-”的毕业生档案，学校已派专人转递至用人单位档案管理部门，请根据接收单位名称和地址与接收单位联系并进行查询。&nbsp;</p><p>所有留在学校的毕业生档案都将在当年12月31日之后转至天津市大中专毕业生就业指导中心。</p>', null, null);
