INSERT INTO `ycity_recruit` VALUES ('50', '钢结构设计师', '1', '1', '1', '120102', '1', '4001-6000', '2', '2', '1', '6', '<p>1.熟悉并掌握MIDAS、3D3S、MSTCAD计算机设计软件的使用。</p><p>2.具有本科学历及专业工程中级以上的职称。</p><p>3.具备设计、汇总、审核的能力。&nbsp;</p>', '<p>1.熟悉并掌握MIDAS、3D3S、MSTCAD计算机设计软件的使用。&nbsp;</p><p>2.具有本科学历及专业工程中级以上的职称。&nbsp;</p><p>3.具备设计、汇总、审核的能力。&nbsp;</p>', '0', '24', '1970-01-01', '1472807175');
INSERT INTO `ycity_resume` VALUES ('1', '1', '1', '27', '汉', '1970-01-01', '浙江省嘉兴市秀城区', '团员', '07610223', '4', '2', '1970-01-01', '1970-01-01', '环境与市政工程系', '给排水工程', '非定向', '备注备注备注', '8', '良好', '<p>1．2009年，积极参与学校、班级、社团组织的各项活动，协助班干部做好板报制作工作。参加秘书协会，主要负责收集资料、协调工作、策划、海报制作等，同时培养了我的团队合作能力、协调组织能力、良好沟通能力。www.jianli-sky.com&nbsp;</p><p>2．2010年，担任文学院秘书协会宣传部部长。主要负责社团活动的对外宣传和宣传海报的设计制作。</p><p>3．2011年，担任文学院秘书协会宣传部部长及通讯社社长。负责总体策划社团的活动宣传和社团活动的留影等。</p><p>4．2012年6月，担任2008级毕业生授业证书的志愿者，主要负责礼仪工作，协助院长授予毕业生毕业证书及学位证书。</p><p>5．2012年9月-12月，在九龙坡区人力资源和社会保障局办公室实习。主要负责打印复印局内各科室资料；收发邮件，整理收文；拟写部分应用行文；领取及传送文件；整理档案，立案归档；发送传真，接打电话，寄送信件；代领导和同事开会，以及部分会议前准备工作等。</p>', '1.\r\n2.\r\n3.\r\n4.', '............', null, null, null, null, null, null, '1970-01-01', '1472799089');
